import { useNavigate } from "react-router-dom";
import { useDispatch } from 'react-redux';
import { dir } from "../store/directionSlice";

const MainPage = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const move = () => {
    navigate('/word');
    dispatch(dir('right'));
  };

  return (
    <body>
    <div class="main-container" id="1:2">
        <div class="today-word" id="today-word">
            <div>
                <div class="group" id="4:412">
                    <div class="inner-group" id="4:408">
                        <div class="search" id="4:436">검색하기</div>
                        <img class="icon"
                            src="/api/try-prod-ap-southeast-1-first-cluster/project..." id="4:407" />
                    </div>
                </div>
                <div class="today-word" id="15:112">오늘의 단어</div>
                <div class="today-word-image" id="today-word-image">
                    <div class="overlay"></div>
                    <div class="rectangle" id="15:109"></div>
                    <div class="question-container" id="15:110">
                        <span class="word-category">테이크 아웃 </span>
                        <span class="word-meaning">이 무슨 말인지</span>
                    </div>
                </div>
                <div class="button-group" id="button-group">
                    <div class="know" id="know">알아요</div>
                    <div class="dont-know" id="dont-know">몰라요</div>
                </div>
            </div>
        </div>
    </div>
</body>

  );
};

export default MainPage;
